// GameWorld - Container for the GameWorld
type GameWorld struct {
	Network
}

// NewGameWorld - Creates a new GameWorld instance
func NewGameWorld() *GameWorld {
	gameWorld := &GameWorld{
		Network{
			Name: "Game Network",
			Port: global.GameWorldPort,
		},
	}
	gameWorld.dataHandler = gameWorld.process
	return gameWorld
}

